//
// Ask the user the latitude
//

val latitude = z.input("Latitude","48.391845").toString.toDouble
z.put("latitudePool",latitude)

//
// Ask the user the longitude
//

val longitude = z.input("Longitude","-4.4905047").toString.toDouble
z.put("longitudePool",longitude)

//
// Ask the user the maximal number of km in which the stations have to be nearby
//

val nbKM = z.input("Area (km)","4").toString.toInt 
z.put("nbKMPool",nbKM)
